import React, { useEffect,useState} from "react";

export default function PoisList(props){

    return(
        <>
            <div className="card" style={{width: "20%"}}>
                <div class="accordion" id="accordionExample">
                    <div className="list-group-item gray-400 d-flex justify-content-between align-items-center ">Points of interest of the item : <button class="btn btn-sm btn-secondary" onClick={props.addItem}>+</button></div>
                    {props.pois.map(d => (
                        <div class="accordion-item">
                            <h2 class="accordion-header" id="headingOne">
                            <button class="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target={"#collapse" + props.pois.indexOf(d)} aria-expanded="false" aria-controls={"collapse" + props.pois.indexOf(d)}>
                                {d.name}
                            </button>
                            </h2>
                            <div id={"collapse" + + props.pois.indexOf(d)} class="accordion-collapse collapse show" aria-labelledby={"heading" + props.pois.indexOf(d)} data-bs-parent="#accordionExample">
                            <div class="accordion-body">
                                <strong>This is the first item's accordion body.</strong> It is shown by default, until the collapse plugin adds the appropriate classes that we use to style each element. These classes control the overall appearance, as well as the showing and hiding via CSS transitions. You can modify any of this with custom CSS or overriding our default variables. It's also worth noting that just about any HTML can go within the <code>.accordion-body</code>, though the transition does limit overflow.
                            </div>
                            </div>  
                        </div>                  
                    ))}
                </div>
            </div>
        </>
    );
}
